function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
            <Route exact path='/catalog'
              render={routerProps => <Catalog {...routerProps} />}
            />
            <Route path='/catalog/:id'
              render={routerProps => <CatalogItem {...routerProps} />}
            />
        </Switch>
      </Router>
    </div>
  )
}

export default App;
